import {
  IonButtons,
  IonContent,
  IonFab,
  IonFabButton,
  IonHeader,
  IonIcon,
  IonMenuButton,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import { add } from "ionicons/icons";
import React from "react";
import Card from "../../components/Card/Card";

const Agents: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Agents</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <Card type="agent" id="agentId" title="Name Surname" subtitle="ComplexName" />
        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton href="/addAgent">
            <IonIcon icon={add}/>
          </IonFabButton>
        </IonFab>
      </IonContent>
    </IonPage>
  );
};

export default Agents;
